/* Context */
import { Card, Container } from "react-bootstrap";
import { useAuthContext } from "../../hooks/useAuthContext";

/* Styling */
import "./Home.css"

export default function Home() {

    const { state } = useAuthContext()

    return (
        <div className="home">
            
            <Container>
                <h1>Welcome { state.username } !</h1>
                <Card>
                    <Card.Body>
                        <>
                        <p>Your stats</p>
            <p>Game played</p>
            <p>Win rate</p> 
                        </>
                    </Card.Body>
                </Card>
            </Container>

        </div>
    )
}
